import React, { useEffect } from 'react';
import axios from 'axios';

import { token2 } from '../token';

export default function WeekWeatherScraper(props) {
    const [weekweather, setWeekWeather] = React.useState([]);

    const latitude = props.coord.lat
    const longitude = props.coord.lon

    const url = `https://api.openweathermap.org/data/2.5/forecast?lat=${latitude}&lon=${longitude}&appid=${token2}&cnt=7&units=metric&lang=ru`;

    useEffect(() => {
        axios.get(url)
            .then(response => {
                setWeekWeather(response.data);
                // console.log(response.data);
            })
            .catch(error => { console.log(error) })
    }, []);

    return (
        <React.Fragment>
            <h1>На этой неделе</h1>
            {weekweather ? <p>{weekweather}</p> : null}
            weekweather.map((weather) => { weather.list.dt_txt })
        </React.Fragment>
    )
}
